import React from 'react'
import { Link, redirect } from 'react-router-dom';

export const ListItem = (props) => {
  const { note } = props;
  return (
    <Link to={{pathname: `/note/${note.id}`, state: note}}>
      <h3>{note?.note_body}</h3>
    </Link>
  )
}
